// frontend/src/App.js
import React from 'react';
import { Routes, Route, useNavigate } from 'react-router-dom';
import Login from './components/Auth/Login';
import Register from './components/Auth/Register';
import Home from './pages/Home';
import DocumentList from './components/Documents/DocumentList';
import DocumentUpload from './components/Scanner/DocumentUploader';
import TransactionList from './components/Transactions/TransactionList';
import TransactionForm from './components/Transactions/TransactionForm';

function App() {
  const navigate = useNavigate();

  const handleTransactionSave = () => {
    navigate('/transactions');  // Redirige a la lista de transacciones después de guardar
  };

  return (
    <Routes>
      <Route path="/login" element={<Login />} />
      <Route path="/register" element={<Register />} />
      <Route path="/" element={<Home />} />
      <Route path="/documents" element={<DocumentList />} />
      <Route path="/upload" element={<DocumentUpload />} />
      <Route path="/transactions" element={<TransactionList />} />
      <Route path="/add-transaction" element={<TransactionForm onSave={handleTransactionSave} />} />
    </Routes>
  );
}

export default App;
